import React from 'react';
import SystemAdminUser from '../Components/SystemAdminUser';

function SystemAdminPage() {
    return (
        <div>
            <h1>System Admin</h1>
            <h5>Users</h5>
            <ul>
                <li><SystemAdminUser /></li>
            </ul>
        </div>
    );
}

export default SystemAdminPage;
